contracts/practice.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >= 0.8.0 < 0.9.0;

contract Bank {

    event info(uint256 balance, string message);

    constructor() payable {
        emit info(address(this).balance, "logging from constructor");
    }

    function deposit() external payable {
        emit info(address(this).balance, "logging from deposit");
    }

    receive() external payable {
        emit info(address(this).balance, "logging from receive");
    }

    fallback() external payable {
        emit info(address(this).balance, string(msg.data));
    }
}

contract Broker {
    Bank private bank;
    address private customer;

    constructor() payable {
        customer = msg.sender;
        bank = new Bank();
    }

    function useBank() public payable returns(bool success) {    
        // bank.deposit{value: msg.value}();
        (success, ) = address(bank).call{value: msg.value}("Hello World");
    }

    function showAddresses() view public returns(address bank_, address customer_, address this_) {
        bank_ = address(bank);
        customer_ = customer;
        this_ = address(this);
    }
}

